import React from 'react'
import {
    Grid, 
    Card, 
    InputBase,
    Select,
    FormControl,
    MenuItem,
    InputLabel }from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme) => ({
    LeftBar:{
        background:"#201B20",
        height:"100vh",
        padding:16
    },
    Heading:{
        fontFamily:"roboto",
        fontSize: 18,
        fontWeight: 400,
        letterSpacing:" 0em",
        color:"#F9F3FA"
    },
    selectBody:{
        background:"#0C0B0B",
        padding:16,
        borderRadius:15,
        margin:"20px 0px"
    },
    labelText:{
        fontSize: 12,
        fontWeight: 'bold',
        color:"#ca18aa",
    },
    inputInput: {
        fontFamily:"roboto",
        fontSize: 14,
        fontWeight: 500,
        letterSpacing:" 0em",
        color:"#B8AFB6",
        // [theme.breakpoints.up('md')]: {
        //   width: '20ch',
        // },
      },
    select: {
        maxWidth: 100,
        fontSize:"0.9rem",
        color: "black",
        borderStyle:'none',
        color:"#F9F3FA",
        padding:0,
        paddingTop:5,
        "&:focus":{
          borderRadius: 4,
          background:"white",
          borderColor:"#201B20"
        },
      },
      icon:{
        right: 12,
        position: 'absolute',
        userSelect: 'none',
        color:"#F9F3FA",
        pointerEvents: 'none'
      },
      paper: {
        borderRadius: 12,
        marginTop: 15,
        maxHeight:300,
      },
      list: {
        paddingTop:0,
        paddingBottom:0,
        background:'white',
        "& li":{
          fontWeight:200,
          paddingTop:12,
          paddingBottom:12,
        },
        "& li:hover":{
          background: "#F9F3FA"
        },
        "& li.Mui-selected":{
          color:'Black',
          fontWeight:200,
          background: "#F9F3FA"
        },
        "& li.Mui-selected:hover":{
          background: "#F9F3FA"
        },
    }
  }));
export default function Filter() {
    const classes = useStyles();

    const iconComponent = (props) => {
        return (
            <ExpandMoreIcon className={props.className + " " + classes.icon}/>
            )};
    const menuProps = {
        classes: {
            paper: classes.paper,
            list: classes.list
        },
        anchorOrigin: {
            vertical: "bottom",
            horizontal: "left"
        },
        transformOrigin: {
            vertical: "top",
            horizontal: "left"
        },
        getContentAnchorEl: null
    };

    return (
        <div>
            <Card className={classes.LeftBar}>
                <div className={classes.text}>
                    <h2 className={classes.Heading}>Find a rental property</h2>
                    <Card className={classes.selectBody}>
                        <InputLabel id="demo-mutiple-chip-label" className={classes.labelText}>Search area</InputLabel>
                        <InputBase
                            placeholder="eg. Oxford or NW3"
                            classes={{
                            input: classes.inputInput,
                            }}
                            inputProps={{ 'aria-label': 'search' }}
                        />
                    </Card>
                    <Card className={classes.selectBody}>
                            <InputLabel id="demo-mutiple-chip-label" className={classes.labelText}>County</InputLabel>
                        <FormControl >
                            <Select
                                SelectDisplayProps={{ style: { minWidth: 100 } }}
                                id="demo-mutiple-chip"
                                // value={context.CountyFilterList }
                                // onChange={handleChangeCounty}
                                classes={{ root: classes.select }}
                                MenuProps={menuProps}
                                disableUnderline
                                IconComponent={iconComponent}
                                >
                                <MenuItem  value="All"  >
                                All
                                </MenuItem>
                                {/* {CountyData.map((name, i) => (
                                    <MenuItem key={i} value={name} >
                                    {name}
                                    </MenuItem>
                                ))} */}
                            </Select>
                        </FormControl>
                    </Card>
                </div>
            </Card>
        </div>
    )
}
